	(403, 'The Manor - Hà Nội', 'KHU ĐÔ THỊ THE MANOR HÀ NỘI   \n  "Lấy cảm hứng từ tên gọi “The Manor” là một cụm từ mang ý nghĩa về một vùng đất tươi đẹp của châu Âu. The Manor Hà Nội đư thiết kế mang hơi hướng của các nét kiến trúc cổ điển, lãng mạn của châu Âu và được mệnh danh là “Paris giữa lòng Hà Nội”.  \n   Chung cư The Manor Hà Nội   \n   Chung cư The Manor    nằm ở phía tây nam Hà Nội, trên đường Mễ Trì, sát mặt đường Lê Đức Thọ, Từ Liêm, Hà Nội là một vị trí khá đắc địa nối giữa thành phố với các địa điểm quan trọng khác như: sân bay quốc tế Nội Bài, Trung tâm hội nghị Quốc gia, Sân vận động Mỹ Đình, Bến xe Mỹ Đình, Trung tâm thương mại BigC The Garden, Bảo tàng Hà Nội, tòa nhà Keangnam, khu đô thị Mỹ Đình 1 và 2, bệnh viện 198, trường ĐH Sư phạm Hà Nội, Đại học Ngoại ngữ…  \n   The Manor Hà Nội    là một tổ hợp công trình bao gồm căn hộ cao cấp, văn phòng, nhà liền kề và biệt thự. Toàn bộ tổ hợp này được thiết kế theo phong cách châu Âu, kết hợp nét cổ điển và hiện đại của kiến trúc Pháp.  \n   The Manor là một tổ hợp bao gồm:   \n  * Các tòa nhà cao tầng, trung tầng:  \n  + Toà nhà AB,và AC cao 26 tầng gồm 502 căn hộ  \n  + Tòa nhà B và C cao 10 tầng gồm 289 căn hộ  \n  * Khu biệt thự  và khu biệt thự liên kế  \n  * Khu trung tâm thương mại : 14.294m2  \n  * Khu villa: 53 villa  \n  * Văn phòng, trường học  \n  * Cửa hàng thời trang  \n  * Nhà hàng, quán café  \n  * Trung tâm giải trí và rạp chiếu phim hiện đại  \n  * Phòng tập thể thao và trung tâm y tế  \n  * Tất cả những tiện nghi sống, dịch vụ đạt tiêu chuẩn quốc tế &nbsp;', 'ha_noi', 403, 403, 504, NULL, NULL, 0, 51, '2024-04-21 14:11:45', '2024-04-21 14:11:45'),
