	(802, 'Nhà Hát Cải Lương Hà Nội', 'Nhà hát Cải Lương Hà Nội  là một nhà hát rất nhỏ chỉ có 250 ghế ngồi, và rất cũ. Nó là một nhân chứng văn hóa đã trải qua nhiều thời đại từ thời Pháp thuộc đến giờ. Và nơi đây vẫn là nơi có những buổi trình diễn cải lương từ sau thế chiến thứ nhất và  được mọi người biết đến như  rạp Chuông Vàng  hiện nay.  \n  Năm 1986 rạp Chuông Vàng đã được ủy ban nhân dân thành phố Hà Nội  gắn biển Lưu niệm sự kiện cách mạng kháng chiến. Hàng năm các cựa chiến binh Thủ đô tổ chức gặp gỡ, thăm hỏi, ôn lại truyền thống chiến đấu dũng cảm "Quyết tử để tổ quốc quyết sinh" tại nơi đây.', 'ha_noi', 802, 802, 903, NULL, NULL, 0, 30, '2024-04-21 14:12:11', '2024-04-21 14:12:11'),
